    public function createGame(Request $request)
    {
        $cookieTokenGenerator = new CookieTokenHelper();
        $token = $cookieTokenGenerator->generateToken(15);

        $owner = $request['players'];
        $owner[0]['location'] = $token;

        $players = json_encode($owner);
        $gameModel = new Game();
        $key = $gameModel->generateGameKey(45);
        $options = json_encode($request['selectedOptions']);
        $rounds = $request['rounds'];

        $letters = $this->getRandomLetterArray($rounds);

        $json = json_encode($letters);

        $game = $gameModel::create([
            'selected_letters' => $json,
            'key' => $key,
            'selected_options' => $options,
            'rounds' => $rounds,
            'players' => $players,
            'round_time' => $request['timePerRound']
        ]);

        $cookie = cookie('player_token', $token, 240);
        return response($game)->cookie($cookie);
    }

    public function loadLobby(Request $request, $uniquecode)
    {
        $game = $this->loadGame($uniquecode);

        return view('game.template.gather-players.index', [
            'uniquecode' => $uniquecode,
            'game' => $game,
            'cookie' => $request->cookie('player_token')
        ]);
    }

    public function loadGame($uniquecode)
    {

        $game = Game::where('key', $uniquecode)->get();

        return $game;
    }

    //TODO:: build in namechecker. If same name just add (1) behind it.
    public function PlayerJoinGame(Request $request, $uniquecode)
    {
        $game = Game::where('key', $uniquecode)->firstOrFail();

        $players = $game->players;

        $cookieTokenGenerator = new CookieTokenHelper();
        $token = $cookieTokenGenerator->generateToken(15);

        $newPlayer = $request->all();
        $newPlayer['location'] = $token;

        $playersArray = json_decode($players, true);
        array_push($playersArray, $newPlayer);
        $playersJson = json_encode($playersArray);
        $newPlayerJson = json_encode($newPlayer);

        $game->players = $playersJson;
        $game->save();

        $cookie = cookie('player_token', $token, 240);
        return response($newPlayerJson)->cookie($cookie);
    }

    public function startGame(Request $request, $uniquecode)
    {
        $game = Game::where('key', $uniquecode)->firstOrFail();
        if ($game->started != 1) {
            $game->started = 1;
            $game->update();
        }

        return view('game.template.game.index', [
            'uniquecode' => $uniquecode,
        ]);
    }

    public function getCookie(Request $request)
    {
        return $request->cookie('player_token');
    }

    public function setPlayerReady(Request $request, $uniquecode)
    {
        $game = Game::where('key', $uniquecode)->firstOrFail();

        $players = $game->players;
        $playersJson = json_decode($players);

        $readyPlayer = $request->all();

        foreach ($playersJson as $index => $player) {
            if ($readyPlayer['location'] === $player->location) {
                $player->ready = 1;
                $readyPlayer['ready'] = 1;
            }
        }

        $game->players = $playersJson;
        $game->update();

        return $readyPlayer;
    }

    public function setPlayerConnected(Request $request, $uniquecode)
    {
        $game = Game::where('key', $uniquecode)->firstOrFail();

        $players = $game->players;
        $playersJson = json_decode($players);

        $readyPlayer = $request->all();

        foreach ($playersJson as $index => $player) {
            if ($readyPlayer['location'] === $player->location) {
                $player->ready = 1;
                $player->connected = 1;
                $readyPlayer['ready'] = 1;
                $readyPlayer['connected'] = 1;
            }
        }

        $game->players = $playersJson;
        $game->update();

        return $readyPlayer;
    }

    function getRandomLetterArray(int $length): array
    {
        $letters = [];

        $availableLetters = str_split('abcdefghijklmnoprstuvwz');
        for ($i = 0; $i < $length; $i++) {
            $index = rand(0, count($availableLetters) - 1);

            $letters[] = $availableLetters[$index];
            // Remove letter from the available letters array.
            array_splice($availableLetters, $index, 1);
        }
        return $letters;
    }

    public function setProgress($uniquecode)
    {
        $game = $this->findGame($uniquecode);
        $game->in_progress = 1;
        $playersJson = json_decode($game->players);

        //Setting player ready state to 0 in order to start the round.
        foreach ($playersJson as $index => $player) {
            $player->ready = 0;
        }

        $game->update();

        return $game;
    }

    public function updateEndRound($uniquecode)
    {
        $game = $this->findGame($uniquecode);
        $game->round_in_progress = 0;

        if ($game->current_round == $game->rounds) {
            $game->finished = 1;
        }
        $game->update();

        return $game;
    }

    public function setRoundProgress($uniquecode)
    {
        $game = $this->findGame($uniquecode);
        $game->round_in_progress = 1;

        if ($game->current_round <= $game->rounds) {
            $game->current_round++;
        }

        $game->update();

        return $game;
    }

    public function startNewRound($uniquecode, $letter)
    {

        $game = $this->findGame($uniquecode);

        $answerArray = $this->buildAnswerArray($game->selected_options, $letter);

        return json_encode($answerArray);
    }

    public function buildAnswerArray($subjects, $letter): array
    {
        $answersArray = [];

        $subjectsArray = json_decode($subjects);


        foreach ($subjectsArray as $index => $subject) {
            $answers[$subject]['answer'] = '';
            $answers[$subject]['correct_answer'] = '';
            $answers[$subject]['points'] = 0;
        }

        $answers['letter'] = $letter;
        return $answers;
    }

    private function findGame($uniquecode)
    {
        $game = Game::where('key', $uniquecode)->firstOrFail();
        return $game;
    }

    public function setPlayerNotReady(Request $request, $uniquecode)
    {
        $game = $this->findGame($uniquecode);

        $players = $game->players;
        $playersJson = json_decode($players);

        $currentPlayer = $request->all();

        foreach ($playersJson as $index => $player) {
            if ($currentPlayer['location'] === $player->location) {
                $player->ready = 0;
                $currentPlayer['ready'] = 0;
            }
        }

        $game->players = $playersJson;
        $game->update();

        return $currentPlayer;

    }

    public function storeAnswer(Request $request, $uniquecode)
    {
        $game = $this->findGame($uniquecode);

        $playerToken = $this->getCookie($request);

        $players = json_decode($game->players);
        foreach ($players as $index => $player) {
            if ($playerToken == $player->location) {
                $Playername = $player->name;
            }
        }

        $answers = json_encode($request->all());
        $answer = GameAnswer::create([
            'game_id' => $game->id,
            'game_round' => $game->current_round,
            'player_cookie' => $playerToken,
            'player_name' => $Playername,
            'answer' => $answers,
            'letter' => $request['letter'],
            'points' => 0

        ]);
    }

    public function getAllAnswersForRound($uniquecode, $currentRound)
    {
        $game = $this->findGame($uniquecode);

        $answers = GameAnswer::where('game_id', $game->id)->where('game_round', $currentRound)->get();

        return $answers;
    }

    //If this turns out to be really slow, we might wanna build a letter comparator to skip the letters not which are not used by the round, for the similar_text function.
    public function CompareAnswers($uniquecode, $currentRound)
    {
        $game = $this->findGame($uniquecode);
        $results = GameAnswer::where('game_id', $game->id)->where('game_round', $currentRound)->get();

        $decodedAnswers = [];
        $answerUniqueness = [];

        foreach ($results as $result) {
            $possibilities = [];
            $answers = $decodedAnswers[$result->id] = json_decode($result['answer'], true);
            foreach ($answers as $topic => $answer) {
                if ('letter' === $topic) {
                    continue;
                }
                foreach (self::POSSIBLE_ANSWERS[$topic] as $index => $possibleAnswer) {

                    similar_text($answer['answer'], $possibleAnswer, $pct);
                    if ($pct > 75) {
                        array_push($possibilities, $possibleAnswer);
                    } else {
                        $answers[$topic]['correct_answer'] = '';
                    }
                }
                if (count($possibilities) >= 2) {
                    foreach ($possibilities as $possibility) {
                        similar_text(strtolower($answer['answer']), strtolower($possibility), $pct);

                        if ($pct > 90) {
                            $answer['correct_answer'] = $possibility;
                            $answers[$topic]['correct_answer'] = $possibility;
                        }
                    }
                } else {
                    foreach ($possibilities as $possibility) {
                        similar_text($answer['answer'], $possibility, $pct);
                        if ($pct == 100) {
                            $answers[$topic]['correct_answer'] = $possibility;
                        } else if ($pct > 75) {
                            $answer['correct_answer'] = $possibility;
                            $answers[$topic]['correct_answer'] = $possibility;
                        } else {
                            $answers[$topic]['correct_answer'] = '';
                        }
                    }
                }
            }
            $result->answer = json_encode($answers);
            $result->update();
        }
        foreach ($results as $result) {
            $answers = $decodedAnswers[$result->id] = json_decode($result['answer'], true);
            foreach ($answers as $topic => $answer) {
                if ('letter' === $topic) {
                    continue;
                }

                if (!isset($answerUniqueness[$topic])) {
                    $answerUniqueness[$topic] = [];
                }

                if (!isset($answerUniqueness[$topic][$answer['correct_answer']])) {
                    $answerUniqueness[$topic][$answer['correct_answer']] = 0;
                }
                $answerUniqueness[$topic][$answer['correct_answer']]++;
            }
        }

        foreach ($results as $index => $result) {
            $answers = $decodedAnswers[$result->id];
            foreach ($answers as $topic => $answer) {
                if ('letter' === $topic) {
                    continue;
                }

                $validAnswer = in_array($answer['correct_answer'], self::POSSIBLE_ANSWERS[$topic]);
                $uniqueAnswer = 1 === $answerUniqueness[$topic][$answer['correct_answer']];

                if (strtolower(substr($answer['correct_answer'], 0, 1)) !== $result->letter) {
                    continue;
                }
                if (!$validAnswer) {
                    continue;
                }

                if ($validAnswer) {
                    $answers[$topic]['points'] += 5;
                    $result->points += 5;
                }

                if ($uniqueAnswer) {
                    $answers[$topic]['points'] += 5;
                    $result->points += 5;
                }
            }
            $answer = json_encode($answers);
            $result->answer = $answer;
            $result->update();
        }

        return $results;

    }

