        $pointsArray = array();

        //Building points array first otherwise the calculating wont work properly.
        foreach ($results as $test => $resultx) {
            $pointsArray[$resultx->player_name] = 0;
        }

        foreach ($results as $index => $resultaat) {
            $pointsArray[$resultaat->player_name] += $resultaat->points;
        }

        $points = json_encode($pointsArray);
        dd($pointsArray);
        return $points;
    }

